import { useState } from 'react';

function useStats() {
  const [stats, useStats] = useState();
  useEffect(() => {
    async function fetchData() {
      console.log('fetching data');
      const data = fetch('https://covid19.mathdro.id/api').then(
        data => data.json
      );
    }
    fetchData();
  }, []);
}

function stats() {
  return (
    <div>
      {' '}
      <p> Stats: </p>
    </div>
  );
}

export default function IndexPage() {
  return (
    <div>
      {' '}
      <stats>
        {' '}
        <p> stats: </p>
      </stats>
    </div>
  );
}
